import { Link } from "react-router-dom";

const Header = () => {
  return (
    <nav style={styles.navbar}>
      <h2 style={styles.logo}>ðŸŽ“ Student Course Management</h2>
      <div style={styles.navLinks}>
        <Link to="/" style={styles.link}>
          Home
        </Link>
        <Link to="/students" style={styles.link}>
          Students
        </Link>
        <Link to="/courses" style={styles.link}>
          Courses
        </Link>
      </div>
    </nav>
  );
};

const styles = {
  navbar: {
    display: "flex",
    justifyContent: "space-between",
    alignItems: "center",
    padding: "15px 30px",
    backgroundColor: "#4CAF50",
    color: "white",
  },
  logo: { margin: 0 },
  navLinks: { display: "flex", gap: "15px" },
  link: { color: "white", textDecoration: "none", fontSize: "18px" },
};

export default Header;
